import React from "react";
import { Node } from "./Pathfinder";

const Element: React.FC<{ node: Node }> = ({ node }) => {
  const extraClass = node.isStart
    ? "node-start"
    : node.isFinish
    ? "node-finish"
    : node.isVisited
    ? "node-visited"
    : node.isWall
    ? "node-wall"
    : "";

  return <div className={`node ${extraClass}`}> {node.column}</div>;
};

export default Element;
